  ];

  return (
    <div>
      <h1>List of product</h1>
      <Container>
        all | Vegetable | Cereal and grains | Fruit | | Agro-chemicals
        <Row>
          {list_of_prods.map((prod) => {
            return (
              <Col sm={12} md={6} lg={4} xl={3}>
